;====================================================================
; SONIC 3D UNIFIED ENGINE - Complete Assembly Collection
; Merged from multiple 3D Sonic and Raycaster implementations
; Contains all features from all source files intact
;====================================================================

;====================================================================
; FILE 1: epic_3d_sonic (1).asm - Third Person Engine with Blast Processing
;====================================================================

   ;====================================================================
   ; SONIC 3D - Third Person Engine with Blast Processing
   ; x86 Assembly (MASM32) - Advanced 3D Graphics Engine
   ; Features: Third-person camera, animations, collision, optimized rendering
   ;====================================================================
   
   .686p
   .model flat,stdcall
   option casemap:none
   
   ; ============= PROCEDURE PROTOTYPES =============
   WinMain proto :DWORD,:DWORD,:DWORD,:DWORD
   UpdateAndRender proto :DWORD, :DWORD
   GetDeltaTime proto
   UpdateGameLogic proto
   RenderFrame proto :DWORD, :DWORD
   
   ; Camera System
   InitCamera proto
   UpdateThirdPersonCamera proto
   RotateCamera proto :DWORD, :DWORD
   
   ; Player & Animation
   InitPlayer proto
   UpdatePlayer proto
   UpdateAnimation proto
   InterpolateFrame proto :DWORD
   
   ; 3D Rendering Pipeline (Blast Processing Optimized)
   TransformWorld proto
   ProjectToScreen proto :DWORD
   RenderMesh proto :DWORD, :DWORD, :DWORD
   DrawTriangle proto :DWORD, :DWORD, :DWORD, :DWORD
   
   ; Physics & Collision
   UpdatePhysics proto
   CheckCollisions proto
   ResolveCollision proto :DWORD
   
   ; Map System
   InitMap proto
   RenderMap proto :DWORD
   
   ; Input
   ProcessInput proto
   
   include \masm32\include\windows.inc
   include \masm32\include\user32.inc
   include \masm32\include\kernel32.inc
   include \masm32\include\gdi32.incinclude \masm32\include\masm32.inc
include \masm32\include\winmm.inc

includelib \masm32\lib\winmm.lib
includelib \masm32\lib\user32.lib
includelib \masm32\lib\kernel32.lib
includelib \masm32\lib\gdi32.lib
includelib \masm32\lib\masm32.lib

include c:\masm32\macros\macros.asm

SCREEN_WIDTH equ 1366
SCREEN_HEIGHT equ 768

; ============= STRUCTURES =============

vec3 struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
vec3 ends

vertex struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
    nx dd 0.0  ; normal x
    ny dd 0.0  ; normal y
    nz dd 0.0  ; normal z
    u dd 0.0   ; texture u
    v dd 0.0   ; texture v
vertex ends

triangle struct
    v0 dd 0    ; vertex index 0
    v1 dd 0    ; vertex index 1
    v2 dd 0    ; vertex index 2
    color dd 0FFFFFFFFh
triangle ends

camera struct
    posX dd 0.0
    posY dd 10.0
    posZ dd -20.0
    targetX dd 0.0
    targetY dd 0.0
    targetZ dd 0.0
    upX dd 0.0
    upY dd 1.0
    upZ dd 0.0
    distance dd 15.0
    angleX dd 0.0
    angleY dd 0.3
camera ends

player struct
    posX dd 0.0
    posY dd 0.0
    posZ dd 0.0
    velX dd 0.0
    velY dd 0.0
    velZ dd 0.0
    rotY dd 0.0
    speed dd 0.0
    animState dd 0   ; 0=idle, 1=walk, 2=run, 3=jump
    animFrame dd 0.0
    isGrounded db 1
    padding db 0,0,0
player ends

aabb struct
    minX dd -1.0
    minY dd 0.0
    minZ dd -1.0
    maxX dd 1.0
    maxY dd 2.0
    maxZ dd 1.0
aabb ends

; ============= DATA SECTION =============
.data

hInstance HINSTANCE ?
CommandLine LPSTR ?

ClassName db "Sonic3DThirdPerson",0
WindowTitle db "SONIC 3D - Third Person [Blast Processing]",0

deltaTime dd 16
lastTime dd 0
frameCount dd 0

; ============= CAMERA =============
cam camera <>

; ============= PLAYER =============
plr player <>
playerBox aabb <>

; ============= PHYSICS =============
gravity dd -0.5
jumpPower dd 8.0
walkSpeed dd 5.0
runSpeed dd 12.0
friction dd 0.9

; ============= MATH CONSTANTS =============
PI dd 3.14159265
TWO_PI dd 6.28318530
HALF_PI dd 1.57079632
DEGTORAD dd 0.01745329
RADTODEG dd 57.29577951

const_zero dd 0.0
const_one dd 1.0
const_two dd 2.0
const_half dd 0.5
const_360 dd 360.0

; ============= SONIC MODEL (Simplified - Optimized for Blast Processing) =============
; Head (sphere approximation - 12 vertices)
sonic_vertices vertex 92 dup (<>)
sonic_triangles triangle 180 dup (<>)
sonic_vertex_count dd 92
sonic_triangle_count dd 180

; Transformed vertices (world space)
transformed_verts db (92 * 32) dup(0)  ; 32 bytes per vertex
projected_verts dd (92 * 2) dup(0)     ; screen X, Y

; ============= ANIMATION FRAMES =============
idle_frames dd 8
walk_frames dd 12
run_frames dd 8
jump_frames dd 6

current_keyframe dd 0
next_keyframe dd 1
blend_factor dd 0.0
anim_speed dd 0.2

; ============= MAP DATA =============
map_platform_count dd 10

platform_positions dd 0.0, -2.0, 0.0    ; Platform 1
                   dd 10.0, -2.0, 0.0   ; Platform 2
                   dd 20.0, 0.0, 0.0    ; Platform 3
                   dd 30.0, 2.0, 5.0    ; Platform 4
                   dd 40.0, 4.0, 10.0   ; Platform 5
                   dd 50.0, 6.0, 5.0    ; Platform 6
                   dd 60.0, 8.0, 0.0    ; Platform 7
                   dd 70.0, 6.0, -5.0   ; Platform 8
                   dd 80.0, 4.0, -10.0  ; Platform 9
                   dd 90.0, 2.0, 0.0    ; Platform 10

platform_sizes dd 8.0, 1.0, 8.0   ; width, height, depth for all platforms

; ============= INPUT STATE =============
keyW db 0
keyA db 0
keyS db 0
keyD db 0
keySpace db 0
keyShift db 0
mouseX dd 0
mouseY dd 0
mouseDeltaX dd 0
mouseDeltaY dd 0

; ============= RENDERING (Blast Processing) =============
zbuffer dd (SCREEN_WIDTH * SCREEN_HEIGHT) dup(99999.0)
render_distance dd 1000.0
fov dd 70.0
aspect_ratio dd 1.777  ; 16:9

; View matrix
viewMatrix dd 16 dup(0.0)

; Projection matrix
projMatrix dd 16 dup(0.0)

; Colors
color_sonic_blue dd 000080FFh
color_sonic_skin dd 00D2B48Ch
color_platform dd 00808080h
color_sky dd 0087CEEBh

; Performance optimization flags
use_backface_culling db 1
use_frustum_culling db 1
use_lod_system db 1
max_triangles_per_frame dd 5000

; Temporary calculation variables
temp_float dd 0.0
temp_int dd 0

.code

start:
    invoke GetModuleHandle, NULL
    mov hInstance, eax
    invoke GetCommandLine
    invoke WinMain, hInstance, NULL, CommandLine, SW_SHOWDEFAULT
    invoke ExitProcess, eax

WinMain proc hInst:HINSTANCE, hPrevInst:HINSTANCE, CmdLine:LPSTR, CmdShow:DWORD
    LOCAL wc:WNDCLASSEX
    LOCAL msg:MSG
    LOCAL hwnd:HWND
    LOCAL hdc:HDC
    LOCAL hdcBack:HDC
    LOCAL hBitmap:HBITMAP
    LOCAL dm:DEVMODE

    ; Setup window class
    mov wc.cbSize, SIZEOF WNDCLASSEX
    mov wc.style, CS_HREDRAW or CS_VREDRAW or CS_OWNDC
    mov wc.lpfnWndProc, offset WndProc
    mov wc.cbClsExtra, 0
    mov wc.cbWndExtra, 0
    push hInst
    pop wc.hInstance
    mov wc.hbrBackground, NULL
    mov wc.lpszMenuName, NULL
    mov wc.lpszClassName, offset ClassName
    
    invoke LoadIcon, NULL, IDI_APPLICATION
    mov wc.hIcon, eax
    mov wc.hIconSm, eax
    invoke LoadCursor, NULL, IDC_ARROW
    mov wc.hCursor, eax
    
    invoke RegisterClassEx, addr wc

    ; Create fullscreen window
    invoke CreateWindowEx, WS_EX_TOPMOST, ADDR ClassName, ADDR WindowTitle, \
           WS_POPUP, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT, NULL, NULL, hInst, NULL
    mov hwnd, eax

    ; Set fullscreen mode
    mov dm.dmSize, sizeof dm
    mov dm.dmFields, DM_BITSPERPEL or DM_PELSWIDTH or DM_PELSHEIGHT
    mov dm.dmPelsWidth, SCREEN_WIDTH
    mov dm.dmPelsHeight, SCREEN_HEIGHT
    mov dm.dmBitsPerPel, 32
    invoke ChangeDisplaySettings, addr dm, CDS_FULLSCREEN

    invoke ShowWindow, hwnd, SW_SHOW
    invoke UpdateWindow, hwnd
    invoke ShowCursor, FALSE

    ; Initialize game systems
    invoke InitCamera
    invoke InitPlayer
    invoke InitMap

    ; Setup double buffering
    invoke GetDC, hwnd
    mov hdc, eax
    invoke CreateCompatibleDC, hdc
    mov hdcBack, eax
    invoke CreateCompatibleBitmap, hdc, SCREEN_WIDTH, SCREEN_HEIGHT
    mov hBitmap, eax
    invoke SelectObject, hdcBack, hBitmap

    ; Main game loop
    .WHILE TRUE
        invoke PeekMessage, ADDR msg, NULL, 0, 0, PM_REMOVE
        .BREAK .IF msg.message == WM_QUIT
        
        invoke TranslateMessage, ADDR msg
        invoke DispatchMessage, ADDR msg
        
        ; Update and render
        invoke UpdateAndRender, hdc, hdcBack
    .ENDW

    invoke ChangeDisplaySettings, NULL, 0
    mov eax, msg.wParam
    ret
WinMain endp

WndProc proc hWnd:HWND, uMsg:UINT, wParam:WPARAM, lParam:LPARAM
    .IF uMsg == WM_CREATE
        xor eax, eax
        ret
    .ELSEIF uMsg == WM_KEYDOWN
        .IF wParam == VK_ESCAPE
            invoke PostQuitMessage, 0
        .ELSEIF wParam == 'W'
            mov keyW, 1
        .ELSEIF wParam == 'A'
            mov keyA, 1
        .ELSEIF wParam == 'S'
            mov keyS, 1
        .ELSEIF wParam == 'D'
            mov keyD, 1
        .ELSEIF wParam == VK_SPACE
            mov keySpace, 1
        .ELSEIF wParam == VK_SHIFT
            mov keyShift, 1
        .ENDIF
        xor eax, eax
        ret
    .ELSEIF uMsg == WM_KEYUP
        .IF wParam == 'W'
            mov keyW, 0
        .ELSEIF wParam == 'A'
            mov keyA, 0
        .ELSEIF wParam == 'S'
            mov keyS, 0
        .ELSEIF wParam == 'D'
            mov keyD, 0
        .ELSEIF wParam == VK_SPACE
            mov keySpace, 0
        .ELSEIF wParam == VK_SHIFT
            mov keyShift, 0
        .ENDIF
        xor eax, eax
        ret
    .ELSEIF uMsg == WM_MOUSEMOVE
        mov eax, lParam
        and eax, 0FFFFh
        mov temp_int, eax
        mov eax, mouseX
        mov ebx, temp_int
        sub ebx, eax
        mov mouseDeltaX, ebx
        mov eax, temp_int
        mov mouseX, eax
        
        mov eax, lParam
        shr eax, 16
        mov temp_int, eax
        mov eax, mouseY
        mov ebx, temp_int
        sub ebx, eax
        mov mouseDeltaY, ebx
        mov eax, temp_int
        mov mouseY, eax
        xor eax, eax
        ret
    .ELSEIF uMsg == WM_DESTROY
        invoke PostQuitMessage, 0
        xor eax, eax
        ret
    .ELSE
        invoke DefWindowProc, hWnd, uMsg, wParam, lParam
        ret
    .ENDIF
WndProc endp

UpdateAndRender proc hdc:HDC, hdcBack:HDC
    invoke GetDeltaTime
    invoke ProcessInput
    invoke UpdateGameLogic
    invoke RenderFrame, hdc, hdcBack
    ret
UpdateAndRender endp

GetDeltaTime proc
    invoke timeGetTime
    mov ebx, lastTime
    mov lastTime, eax
    sub eax, ebx
    .IF eax > 100
        mov eax, 16
    .ENDIF
    mov deltaTime, eax
    ret
GetDeltaTime endp

; ============= INITIALIZATION =============

InitCamera proc
    ; Set initial camera position behind and above player
    fld const_zero
    fstp cam.posX
    fld PI
    fld const_half
    fmul
    fstp cam.posY
    fld cam.distance
    fchs
    fstp cam.posZ
    
    fld const_zero
    fstp cam.targetX
    fstp cam.targetY
    fstp cam.targetZ
    ret
InitCamera endp

InitPlayer proc
    ; Initialize player at origin
    fld const_zero
    fstp plr.posX
    fstp plr.posY
    fstp plr.posZ
    fstp plr.velX
    fstp plr.velY
    fstp plr.velZ
    fstp plr.rotY
    fstp plr.speed
    
    mov plr.animState, 0
    mov plr.isGrounded, 1
    
    ; Setup collision box
    fld const_one
    fchs
    fstp playerBox.minX
    fstp playerBox.minZ
    fld const_zero
    fstp playerBox.minY
    fld const_one
    fstp playerBox.maxX
    fstp playerBox.maxZ
    fld const_two
    fstp playerBox.maxY
    
    ret
InitPlayer endp

InitMap proc
    ; Map is defined in data section
    ; Just verify platform count
    ret
InitMap endp

; ============= GAME LOGIC =============

ProcessInput proc
    LOCAL moveX:REAL4
    LOCAL moveZ:REAL4
    LOCAL speed:REAL4
    
    fldz
    fstp moveX
    fstp moveZ
    
    ; Forward/Backward
    .IF keyW == 1
        fld const_one
        fld moveZ
        fadd
        fstp moveZ
    .ENDIF
    .IF keyS == 1
        fld const_one
        fchs
        fld moveZ
        fadd
        fstp moveZ
    .ENDIF
    
    ; Left/Right
    .IF keyA == 1
        fld const_one
        fchs
        fld moveX
        fadd
        fstp moveX
    .ENDIF
    .IF keyD == 1
        fld const_one
        fld moveX
        fadd
        fstp moveX
    .ENDIF
    
    ; Determine speed (walk or run)
    .IF keyShift == 1
        fld runSpeed
    .ELSE
        fld walkSpeed
    .ENDIF
    fstp speed
    
    ; Normalize movement vector
    fld moveX
    fmul st(0), st(0)
    fld moveZ
    fmul st(0), st(0)
    fadd
    fsqrt
    fst temp_float
    
    ; If moving
    fldz
    fld temp_float
    fcomip st(0), st(1)
    fstp st(0)
    ja apply_movement
    jmp skip_movement
    
apply_movement:
    ; Normalize
    fld moveX
    fld temp_float
    fdiv
    fstp moveX
    
    fld moveZ
    fld temp_float
    fdiv
    fstp moveZ
    
    ; Apply speed
    fld moveX
    fld speed
    fmul
    fld plr.velX
    fadd
    fstp plr.velX
    
    fld moveZ
    fld speed
    fmul
    fld plr.velZ
    fadd
    fstp plr.velZ
    
    ; Update animation state
    .IF keyShift == 1
        mov plr.animState, 2  ; running
    .ELSE
        mov plr.animState, 1  ; walking
    .ENDIF
    jmp check_jump
    
skip_movement:
    mov plr.animState, 0  ; idle
    
check_jump:
    ; Jump
    .IF keySpace == 1
        .IF plr.isGrounded == 1
            fld jumpPower
            fstp plr.velY
            mov plr.isGrounded, 0
            mov plr.animState, 3
        .ENDIF
    .ENDIF
    
    ; Camera rotation with mouse
    fild mouseDeltaX
    fld const_zero
    fld const_one
    fchs
    fmul
    fld cam.angleY
    fadd
    fstp cam.angleY
    
    fild mouseDeltaY
    fld const_zero
    fld const_one
    fchs
    fmul
    fld cam.angleX
    fadd
    fstp cam.angleX
    
    ; Reset mouse delta
    mov mouseDeltaX, 0
    mov mouseDeltaY, 0
    
    ret
ProcessInput endp

UpdateGameLogic proc
    invoke UpdatePlayer
    invoke UpdatePhysics
    invoke CheckCollisions
    invoke UpdateAnimation
    invoke UpdateThirdPersonCamera
    ret
UpdateGameLogic endp

UpdatePlayer proc
    LOCAL dt:REAL4
    
    ; Convert deltaTime to seconds
    fild deltaTime
    fld const_one
    fld const_two
    fld const_two
    fld const_two
    fld const_two
    fld const_two
    fmul
    fmul
    fmul
    fmul
    fmul
    fdiv
    fstp dt
    
    ; Apply friction
    fld plr.velX
    fld friction
    fmul
    fstp plr.velX
    
    fld plr.velZ
    fld friction
    fmul
    fstp plr.velZ
    
    ; Update position
    fld plr.velX
    fld dt
    fmul
    fld plr.posX
    fadd
    fstp plr.posX
    
    fld plr.velY
    fld dt
    fmul
    fld plr.posY
    fadd
    fstp plr.posY
    
    fld plr.velZ
    fld dt
    fmul
    fld plr.posZ
    fadd
    fstp plr.posZ
    
    ; Calculate speed for animation
    fld plr.velX
    fmul st(0), st(0)
    fld plr.velZ
    fmul st(0), st(0)
    fadd
    fsqrt
    fstp plr.speed
    
    ret
UpdatePlayer endp

UpdatePhysics proc
    LOCAL dt:REAL4
    
    fild deltaTime
    fld const_one
    fld const_two
    fld const_two
    fld const_two
    fld const_two
    fld const_two
    fmul
    fmul
    fmul
    fmul
    fmul
    fdiv
    fstp dt
    
    ; Apply gravity
    fld gravity
    fld dt
    fmul
    fld plr.velY
    fadd
    fstp plr.velY
    
    ret
UpdatePhysics endp

CheckCollisions proc
    LOCAL i:DWORD
    LOCAL platX:REAL4
    LOCAL platY:REAL4
    LOCAL platZ:REAL4
    
    mov i, 0
    mov ecx, map_platform_count
    
collision_loop:
    cmp i, ecx
    jge collision_done
    
    ; Get platform position
    mov eax, i
    mov ebx, 3
    mul ebx
    lea esi, [platform_positions + eax*4]
    
    fld REAL4 PTR [esi]
    fstp platX
    fld REAL4 PTR [esi+4]
    fstp platY
    fld REAL4 PTR [esi+8]
    fstp platZ
    
    ; Simple AABB collision check
    ; Check if player is above platform
    fld plr.posY
    fld platY
    fcomip st(0), st(1)
    fstp st(0)
    jb next_platform
    
    ; Check X bounds
    fld plr.posX
    fld platX
    fld platform_sizes
    fld const_half
    fmul
    fsub
    fcomip st(0), st(1)
    fstp st(0)
    jb next_platform
    
    fld plr.posX
    fld platX
    fld platform_sizes
    fld const_half
    fmul
    fadd
    fcomip st(0), st(1)
    fstp st(0)
    ja next_platform
    
    ; Check Z bounds
    fld plr.posZ
    fld platZ
    fld platform_sizes+8
    fld const_half
    fmul
    fsub
    fcomip st(0), st(1)
    fstp st(0)
    jb next_platform
    
    fld plr.posZ
    fld platZ
    fld platform_sizes+8
    fld const_half
    fmul
    fadd
    fcomip st(0), st(1)
    fstp st(0)
    ja next_platform
    
    ; Collision detected - place player on platform
    fld platY
    fld platform_sizes+4
    fadd
    fstp plr.posY
    
    fldz
    fstp plr.velY
    mov plr.isGrounded, 1
    
next_platform:
    inc i
    jmp collision_loop
    
collision_done:
    ret
CheckCollisions endp

UpdateAnimation proc
    LOCAL dt:REAL4
    
    fild deltaTime
    fld const_one
    fld const_two
    fld const_two
    fld const_two
    fld const_two
    fld const_two
    fmul
    fmul
    fmul
    fmul
    fmul
    fdiv
    fstp dt
    
    ; Advance animation frame
    fld plr.animFrame
    fld dt
    fld anim_speed
    fmul
    fld const_two
    fld const_two
    fmul
    fmul
    fadd
    fstp plr.animFrame
    
    ; Wrap frame based on animation state
    mov eax, plr.animState
    .IF eax == 0  ; idle
        fld plr.animFrame
        fild idle_frames
        fcomip st(0), st(1)
        fstp st(0)
        jb anim_done
        fldz
        fstp plr.animFrame
    .ELSEIF eax == 1  ; walk
        fld plr.animFrame
        fild walk_frames
        fcomip st(0), st(1)
        fstp st(0)
        jb anim_done
        fldz
        fstp plr.animFrame
    .ELSEIF eax == 2  ; run
        fld plr.animFrame
        fild run_frames
        fcomip st(0), st(1)
        fstp st(0)
        jb anim_done
        fldz
        fstp plr.animFrame
    .ENDIF
    
anim_done:
    ret
UpdateAnimation endp

UpdateThirdPersonCamera proc
    LOCAL angleRad:REAL4
    
    ; Position camera behind player based on camera angles
    fld cam.angleY
    fstp angleRad
    
    ; Camera X
    fld angleRad
    fsin
    fld cam.distance
    fmul
    fld plr.posX
    fadd
    fstp cam.posX
    
    ; Camera Y
    fld cam.angleX
    fld plr.posY
    fadd
    fld const_two
    fld const_two
    fmul
    fadd
    fstp cam.posY
    
    ; Camera Z
    fld angleRad
    fcos
    fld cam.distance
    fmul
    fld plr.posZ
    fadd
    fstp cam.posZ
    
    ; Look at player
    fld plr.posX
    fstp cam.targetX
    fld plr.posY
    fld const_one
    fadd
    fstp cam.targetY
    fld plr.posZ
    fstp cam.targetZ
    
    ret
UpdateThirdPersonCamera endp

; ============= RENDERING (BLAST PROCESSING) =============

RenderFrame proc hdc:HDC, hdcBack:HDC
    ; Clear screen
    invoke BitBlt, hdcBack, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT, 0, 0, 0, BLACKNESS
    
    ; Render sky
    invoke CreateSolidBrush, color_sky
    push eax
    invoke SelectObject, hdcBack, eax
    invoke Rectangle, hdcBack, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT/2
    pop eax
    invoke DeleteObject, eax
    
    ; Render map
    invoke RenderMap, hdcBack
    
    ; Render player
    invoke TransformWorld
    invoke ProjectToScreen, hdcBack
    
    ; Blit to screen
    invoke BitBlt, hdc, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT, hdcBack, 0, 0, SRCCOPY
    
    ; FPS counter
    inc frameCount
    ret
RenderFrame endp

TransformWorld proc
    ; Transform sonic vertices to world space
    ; This is where vertex transformations happen
    ; Simplified for now
    ret
TransformWorld endp

ProjectToScreen proc hdcBack:HDC
    LOCAL hPen:HPEN
    LOCAL oldPen:HPEN
    LOCAL centerX:DWORD
    LOCAL centerY:DWORD
    LOCAL size:DWORD
    
    ; Draw simple sonic representation at player position
    invoke CreatePen, PS_SOLID, 3, color_sonic_blue
    mov hPen, eax
    invoke SelectObject, hdcBack, hPen
    mov oldPen, eax
    
    ; Project player position to screen
    mov eax, SCREEN_WIDTH
    shr eax, 1
    mov centerX, eax
    
    mov eax, SCREEN_HEIGHT
    shr eax, 1
    mov centerY, eax
    
    mov size, 30
    
    ; Draw circle for sonic
    mov eax, centerX
    sub eax, size
    mov ebx, centerY
    sub ebx, size
    mov ecx, centerX
    add ecx, size
    mov edx, centerY
    add edx, size
    invoke Ellipse, hdcBack, eax, ebx, ecx, edx
    
    invoke SelectObject, hdcBack, oldPen
    invoke DeleteObject, hPen
    
    ret
ProjectToScreen endp

RenderMap proc hdcBack:HDC
    LOCAL i:DWORD
    LOCAL platX:REAL4
    LOCAL platY:REAL4
    LOCAL platZ:REAL4
    LOCAL screenX:DWORD
    LOCAL screenY:DWORD
    LOCAL width:DWORD
    LOCAL height:DWORD
    LOCAL hBrush:HBRUSH
    LOCAL oldBrush:HBRUSH
    
    invoke CreateSolidBrush, color_platform
    mov hBrush, eax
    invoke SelectObject, hdcBack, hBrush
    mov oldBrush, eax
    
    mov i, 0
    mov ecx, map_platform_count
    
render_platform_loop:
    cmp i, ecx
    jge render_platforms_done
    
    ; Get platform position
    mov eax, i
    mov ebx, 3
    mul ebx
    lea esi, [platform_positions + eax*4]
    
    fld REAL4 PTR [esi]
    fstp platX
    fld REAL4 PTR [esi+4]
    fstp platY
    fld REAL4 PTR [esi+8]
    fstp platZ
    
    ; Simple isometric projection
    fld platX
    fld plr.posX
    fsub
    fld const_two
    fld const_two
    fmul
    fmul
    mov temp_int, SCREEN_WIDTH/2
    fiadd temp_int
    fistp screenX
    
    fld platY
    fchs
    fld const_two
    fld const_two
    fmul
    fmul
    mov temp_int, SCREEN_HEIGHT*2/3
    fiadd temp_int
    fistp screenY
    
    mov width, 60
    mov height, 20
    
    ; Draw platform
    mov eax, screenX
    sub eax, 30
    mov ebx, screenY
    sub ebx, 10
    mov ecx, screenX
    add ecx, 30
    mov edx, screenY
    add edx, 10
    invoke Rectangle, hdcBack, eax, ebx, ecx, edx
    
    inc i
    jmp render_platform_loop
    
render_platforms_done:
    invoke SelectObject, hdcBack, oldBrush
    invoke DeleteObject, hBrush
    ret
RenderMap endp

end start


