SynthesizeTone proc frequency:DWORD, duration:DWORD

; Simple sine wave synthesis at given frequency

; frequency: Hz, duration: milliseconds

LOCAL sample_count:DWORD

LOCAL i:DWORD

LOCAL phase_increment:REAL4

; Calculate phase increment = 2*PI*frequency / sample_rate

fninit

fld 3.14159 ; PI approximation

fld2

fmul ; 2*PI

fild frequency

fmul

fild audio_sample_rate

fdiv

fstp phase_increment

; Calculate number of samples

mov eax, audio_sample_rate

mov ebx, 1000

mul ebx

