fld current_phase

fsin

fld audio_amplitude

fmul

fist sine_accumulator

; Update phase

fld current_phase

fld phase_increment

fadd

fstp current_phase

; Wrap phase at 2*PI

fld current_phase

fld 6.28318 ; 2*PI

fcomp

fstsw ax

sahf

jbe phase_ok

fldz

fstp current_phase

phase_ok:

inc i

jmp synth_loop

synth_done:

Ret

