UpdateGravity proc

; Apply gravity force: acceleration = gravity * dt

fninit

fld gravity_constant

fild dtime

fmul

fld player.Velocity.Y

fadd

; Clamp fall speed

fld max_fall_speed

fcomi st(0), st(1) ; Compare max_fall_speed with new velocity

jbe gravity_no_clamp

fld max_fall_speed

fstp player.Velocity.Y

jmp gravity_exit

gravity_no_clamp:

fstp player.Velocity.Y

gravity_exit:

Ret

UpdateGravity EndP

CheckPlatformCollision proc

; Simple ground collision

fninit

fld player.Position.Y

fld ground_level

fcomp

fstsw ax

sahf

jbe no_collision

; Collision detected - snap to ground

mov player.IsGrounded, 1

fninit

fld ground_level

fstp player.Position.Y

; Zero vertical velocity

fldz

fstp player.Velocity.Y

jmp collision_exit

no_collision:

mov player.IsGrounded, 0

collision_exit:

Ret

CheckPlatformCollision EndP

ResolveJump proc

; Only allow jump if on ground

cmp player.IsGrounded, 1

jne jump_exit

; Apply jump velocity

fninit

fld jump_force

fstp player.Velocity.Y

mov player.IsGrounded, 0

; Play jump sound

invoke PlaySoundEffect, 1 ; 1 = jump effect

