TransformVertices proc

LOCAL i:DWORD

LOCAL x_rot:REAL4

LOCAL y_rot:REAL4

LOCAL z_rot:REAL4

; Transform = Translation + Rotation

; For now, simple translation by player position

mov i, 0

transform_loop:

cmp i, num_sonic_vertices

jge transform_done

; Get source vertex

lea eax, [sonic_vertices + i*sizeof(vertex3d)]

lea ebx, [projected_vertices + i*sizeof(vertex3d)]

; Copy and apply player position offset

fninit

fld [eax].vertex3d.Pos.X

fld player.Position.X

fadd

fstp [ebx].vertex3d.Pos.X

fld [eax].vertex3d.Pos.Y

fld player.Position.Y

fadd

fstp [ebx].vertex3d.Pos.Y

fld [eax].vertex3d.Pos.Z

fld player.Position.Z

