cmp i, num_sonic_vertices

jge project_done

lea eax, [projected_vertices + i*sizeof(vertex3d)]

; Simple perspective projection

; screen_x = (vertex.x * fov) / vertex.z + center_x

; screen_y = (vertex.y * fov) / vertex.z + center_y

fninit

fld [eax].vertex3d.Pos.X

fld camera_fov

fmul

fld [eax].vertex3d.Pos.Z

fdiv

mov ecx, SCREEN_WIDTH

shr ecx, 1

fild ecx

fadd

fist [eax].vertex3d.Projected ; Store as DWORD screen_x

fld [eax].vertex3d.Pos.Y

fld camera_fov

fmul

fld [eax].vertex3d.Pos.Z

fdiv

mov ecx, SCREEN_HEIGHT

shr ecx, 1

fild ecx

fadd

fist [eax].vertex3d.Projected + 4 ; Store as DWORD screen_y

inc i

jmp project_loop

project_done:

Ret

