SynthesizeTone proc frequency:DWORD, duration:DWORD

; Simple sine wave synthesis at given frequency

; frequency: Hz, duration: milliseconds

LOCAL sample_count:DWORD

LOCAL i:DWORD

LOCAL phase_increment:REAL4

; Calculate phase increment = 2*PI*frequency / sample_rate

fninit

fld 3.14159 ; PI approximation

fld2

fmul ; 2*PI

fild frequency

fmul

fild audio_sample_rate

fdiv

fstp phase_increment

; Calculate number of samples

mov eax, audio_sample_rate

mov ebx, 1000

mul ebx

div duration

mov sample_count, eax

mov i, 0

synth_loop:

cmp i, sample_count

jge synth_done

; Generate sine value

fninit

fld current_phase

fsin

fld audio_amplitude

fmul

fist sine_accumulator

; Update phase

fld current_phase

fld phase_increment

fadd

fstp current_phase

; Wrap phase at 2*PI

fld current_phase

fld 6.28318 ; 2*PI

fcomp

fstsw ax

sahf

jbe phase_ok

fldz

fstp current_phase

phase_ok:

inc i

jmp synth_loop

synth_done:

Ret

SynthesizeTone EndP

