GetDt EndP

Render proc hdc:HDC, hdcBack:HDC

        invoke BitBlt,hdcBack, 0, 0, SCREEN_WIGTH, SCREEN_HEIGHT, 0, 0, 0,WHITENESS;BLACKNESS

    ;RENDER

        invoke RayCastingEngine,hdcBack
        ;invoke RenderWallK,hdcBack,1, 10, RenderColorTest

            ;Render coordinate
        invoke RenderCoord,hdcBack
        invoke TestRenderKeys, hdcBack

    ;END RENDER

        invoke BitBlt,hdc, 0, 0, SCREEN_WIGTH, SCREEN_HEIGHT, hdcBack, 0, 0,SRCCOPY
    ;invoke ReleaseDC,hWnd, hdc

    Ret
Render EndP

UpdateLogic proc
    ;MOVE LEFT, RIGHT
        ;Test if active key
                xor eax, eax
                or al, key_state
                and ax, 9  ;1001
                cmp eax, 0
                je  UpdateLogicNextKeys
        ;test left or right
            .if     (eax==1)        ;0001   ( key right)
                mov turnSign, 1
            .else                   ;1000   ( key left)
                mov turnSign, -1
            .endif

                fninit
                    fld     turnConst
                    fild    dtime
                    fmul
                    fild    turnSign
                    fmul
                    fld     player.Angle
                    fadd
                    fst     player.Angle

            ;make normal
                ;test <0
                    fldz
                    fld     player.Angle
                    fcomi   st(0), st(1)    ;cmp angle, 0
                wait
                jae norm_fprem
                    fld1
                    fldpi
                    fscale  ;2 pi
                    fld     player.Angle
                    fadd
                    fst     player.Angle
                jmp UpdateLogicNextKeys
                ;test >2pi
                norm_fprem:
                    fld1
                    fldpi
                    fscale                  ;2 pi
                    fld     player.Angle

                    fcomi   st(0), st(1)    ;cmp angle, 0
                wait
                    jb UpdateLogicNextKeys
                    fprem
                    fst     player.Angle
        UpdateLogicNextKeys:
    ;MOVE UP, DOWN
                        ;===========================need to write clipping!
        ;test if active key
            xor eax, eax
                or al, key_state
                and ax, 6  ;0110
                cmp eax, 0
            je  UpdateLogicExit

        .if (eax==4)                ;0100 (key up)
            mov turnSign, 1
        .else                       ;0010 (key down)
            mov turnSign, -1
        .endif

            fninit
                    fild    dtime
                    fld     moveConst
                    fmul
                    fild    turnSign
                    fmul
                    fst     bufd

                ; it's X
                    fld     player.Angle
                    fsin
                    fld     bufd
                    fmul
                    fld     player.X
                    fadd
                    fst     bufX_dd
                    fist    bufX_dw
                ;it's Y
                    fld     player.Angle
                    fcos
                    fld     bufd
                    fmul
                    fld     player.Y
                    fadd
                    fst     bufY_dd
                    fist    bufY_dw

            cmp bufY_dw,0
                jl UpdateLogicExit
            cmp  bufY_dw,64
                jg UpdateLogicExit
            cmp bufX_dw,0
                jl UpdateLogicExit
            cmp bufX_dw,64
                jg UpdateLogicExit

            ;xor eax, eax
            mov ax, bufY_dw
            CWDE
            mov bx, 65
            mul bx
            mov ebx, eax
            mov ax, bufX_dw
            CWDE
            add ebx, eax

            cmp ebx, 4225
            jge UpdateLogicExit

            mov esi, offset map
            mov al, [esi+ebx]

            cmp al, 1
            je  UpdateLogicExit

            fninit
                fld     bufX_dd
                fst     player.X

                fld     bufY_dd
                fst     player.Y
            wait

    UpdateLogicExit:
    Ret
UpdateLogic EndP

RenderWallK proc hdcBack:HDC, h:DWORD, x:DWORD, color:DWORD
    LOCAL l:DWORD
    LOCAL hPen:HPEN
    LOCAL holdPen:HPEN

    mov eax, h
    cmp eax, 0
    jl  uexit

    ; Calculate l and h
    mov eax, SCREEN_HEIGHT  ; SCREEN_HEIGHT + 1
    inc eax
    sub eax, h
    shr eax, 1
    mov l, eax
    add eax, h
    mov h, eax ; Now h is the bottom of the wall

    ; Draw ceiling
    invoke CreatePen, PS_SOLID, 1, CEILING_COLOR
    mov hPen, eax
    invoke SelectObject, hdcBack, hPen
    mov holdPen, eax

    invoke MoveToEx, hdcBack, x, 0, NULL
    invoke LineTo, hdcBack, x, l

    invoke SelectObject, hdcBack, holdPen
    invoke DeleteObject, hPen

    ; Draw wall
    invoke CreatePen, PS_SOLID, 1, color
    mov hPen, eax
    invoke SelectObject, hdcBack, hPen
    mov holdPen, eax

    invoke MoveToEx, hdcBack, x, l, NULL
    invoke LineTo, hdcBack, x, h

    invoke SelectObject, hdcBack, holdPen
    invoke DeleteObject, hPen

    ; Draw floor
    invoke CreatePen, PS_SOLID, 1, FLOOR_COLOR
    mov hPen, eax
    invoke SelectObject, hdcBack, hPen
    mov holdPen, eax

    invoke MoveToEx, hdcBack, x, h, NULL
    invoke LineTo, hdcBack, x, SCREEN_HEIGHT

    invoke SelectObject, hdcBack, holdPen
    invoke DeleteObject, hPen

uexit:
    Ret
RenderWallK EndP

TestRenderKeys proc hdcBack:HDC
                    xor eax, eax

                    mov al, key_state
                    mov ebx, eax
                    and al, 4
                    je  t_k_left
                    invoke TextOut,hdcBack,1250,600,ADDR textkey_up,4
        t_k_left:   mov eax, ebx
                    and al, 8
                    je t_k_right
                    invoke TextOut,hdcBack,1200,650,ADDR textkey_left,4
        t_k_right:  mov eax, ebx
                    and al, 1
                    je t_k_down
                    invoke TextOut,hdcBack,1300,650,ADDR textkey_right,5
        t_k_down:   and bl, 2
                    je t_k_exit
                    invoke TextOut,hdcBack,1250,700,ADDR textkey_down,4
        t_k_exit:   

    Ret
TestRenderKeys EndP

RenderCoord proc   hdcBack:HDC                 ;out only integer part!

    ;print X coord
        invoke TextOut,hdcBack, 1100, 5, addr coordXe, 2
        fninit
            ;fnstcw bufw
            ;or     [bufw], 3072      ;10-11 bits   3= -> 0
            ;fldcw  bufw

            fld player.X
            frndint

            fist bufw
        wait
            invoke RtlZeroMemory, addr bufb, 10  
        ;xor eax, eax
        mov ax, bufw
        CWDE
        invoke dwtoa, eax, addr bufb
        invoke TextOut,hdcBack, 1120, 5, addr bufb, 10
    ;print Y coord
        invoke TextOut,hdcBack, 1100, 25, addr coordYe, 2
        fninit
            ;fnstcw bufw
            ;or     [bufw], 3072      ;10-11 bits   3= -> 0
            ;fldcw  bufw

            fld player.Y
            frndint

            fist bufw
        wait
            invoke RtlZeroMemory, addr bufb, 10
        mov ax, bufw
        CWDE
        invoke dwtoa, eax, addr bufb
        invoke TextOut,hdcBack, 1120, 25, addr bufb, 10
    ;print angle
        invoke TextOut,hdcBack, 1100, 55, addr coordAngle, 7
        fninit
            fld     player.Angle;bufd
            fild    num180
            fmul
            fldpi
            fdiv
            fist bufw
        wait
            invoke RtlZeroMemory, addr bufb, 10
        mov ax, bufw
        CWDE
        invoke dwtoa, eax, addr bufb
        invoke TextOut,hdcBack, 1152, 55, addr bufb, 10

    Ret
RenderCoord EndP


RayCastingEngine proc hdcBack:HDC
    LOCAL   cpixelX:DWORD
    LOCAL   scrX:DWORD
    LOCAL   scrH:DWORD
    LOCAL   scrCol:DWORD

        mov cpixelX, -682

    RayCastingEngineCycle:
            ;update angle for wall
            fninit
                fild    cpixelX
                fld     RadianPerPixel
                fmul
                fld     player.Angle
                fadd
                fst     bufAngle
            wait

            mov eax, cpixelX
            add eax, 682
            mov scrX, eax

            mov     lenWallY, 0
            mov     lenWallX, 0

            invoke FindWallRayY
            invoke FindWallRayX
            mov eax, lenWallY
            mov ebx, lenWallX

            .if (eax > ebx)
                mov scrH, eax
            .else   
                mov scrH, ebx
            .endif

            ; Set the wall color to green
            .if (scrH >= 1250) 
                mov scrCol, 0FF00h    ; Set to pure green
            .else
                fninit
                    fld     colorConst
                    fld     scrH
                    fdiv    st(0), st(1)
                    fist    scrCol
                wait     
                shl     scrCol,8     ; Shift into green component
            .endif

            invoke RenderWallK,hdcBack, scrH, scrX, scrCol

            next_w:
            inc cpixelX
            cmp cpixelX, 682
        jl  RayCastingEngineCycle

    RayCastingEngineExit:
    Ret

RayCastingEngine EndP 

FindWallRayY proc

    ;dx and dy
            fninit
                fld     bufAngle
                fsin
                fst     dxLook

                fld     bufAngle
                fcos
                fst     dyLook
            wait

    ;test dy 0
        fninit
            fld     dyLook
            fabs
            fld     epsilon
            fcomi  st(0), st(1)
        wait
            jae FindWallRayYExit

    ;make normal dy
        fninit     
            fld     dyLook
            fabs
            fld     dxLook
            fdiv    st(0), st(1)
            fst     dxLook

            fld     dyLook
            fld     dyLook
            fabs
            fdiv
            frndint
            fst     dyLook
        wait
    ;make x0, y0      
        fninit
            fld     num0dot5
            fld     dyLook
            fmul
            fchs    ;-0.5 or +0.5

            fld     player.Y
            frndint

            fadd    ;==y0

            fst     bufY_dd

            fld     player.Y
            fsub    st(0), st(1)    ;=Y-Y0

            fld     dxLook
            fmul                    ;=(Y-Y0)*dx

            fld     dyLook
            fdivp   st(1), st(0)    ;or fdivp   st(1), st(0)

            fchs
            fld     player.X
            fadd            ;its x0

            fst     bufX_dd

            fld epsilon
            fld dyLook
            fmul
            fst lookEpsilon
        wait

    ;Cycle
        FindWallRayYRepeat:
            fninit
                fld     dxLook
                fld     bufX_dd
                fadd
                fst     bufX_dd
                frndint
                fist    bufX_dw

                fld     dyLook
                fld     bufY_dd
                fadd
                fst     bufY_dd
                fld     lookEpsilon
                fadd
                frndint
                fist    bufY_dw
            wait

            cmp bufY_dw,0
                jl FindWallRayYExit
            cmp  bufY_dw,65
                jg FindWallRayYExit
            cmp bufX_dw,0
                jl FindWallRayYExit
            cmp bufX_dw,65
                jg FindWallRayYExit

            ;xor eax, eax
            mov ax, bufY_dw
            CWDE
            mov bx, 65
            mul bx
            mov ebx, eax
            mov ax, bufX_dw
            CWDE
            add ebx, eax

            cmp ebx, 4225
            jge FindWallRayYExit

            mov esi, offset map
            mov al, [esi+ebx]

            cmp al, 1
            jne FindWallRayYRepeat

                ;length sqrt(x^2 + y^2)
                fninit
                    fld     player.Y
                    fld     bufY_dd
                    fsub
                    fabs
                    fst     bufY_dd
                    fld     bufY_dd
                    fmul
                    fst     bufd

                    fld     player.X
                    fld     bufX_dd
                    fsub
                    fst     bufX_dd
                    fld     bufX_dd
                    fmul

                    fld     bufd
                    fadd
                    fsqrt

                    fild    WallConst
                    fdivr
                    fist    lenWallY
                wait

    FindWallRayYExit:  
    Ret
FindWallRayY EndP

FindWallRayX        proc
    ;dx and dy
            fninit
                fld     bufAngle
                fsin
                fst     dxLook

                fld     bufAngle
                fcos
                fst     dyLook
            wait

    ;test dx 0
        fninit
            fld     dxLook
            fabs
            fld     epsilon
            fcomi  st(0), st(1)
        wait
            jae FindWallRayXExit

    ;make normal dx
        fninit     
            fld     dxLook
            fabs
            fld     dyLook
            fdiv    st(0), st(1)
            fst     dyLook

            fld     dxLook
            fld     dxLook
            fabs
            fdiv
            frndint
            fst     dxLook
        wait  

    ;make x0, y0      
        fninit
            fld     num0dot5
            fld     dxLook
            fmul
            fchs    ;-0.5 or +0.5

            fld     player.X
            frndint

            fadd    ;==x0

            fst     bufX_dd

            fld     player.X
            fsub    st(0), st(1)    ;=X-X0

            fld     dyLook
            fmul                    ;=(X-X0)*dy

            fld     dxLook
